import React from 'react';

import Navbar from 'react-bootstrap/Navbar';

var sass = require("sass");

sass.render({
  file: "Nav.scss",
  importer: function(url, prev, done) {
    // ...
  }
}, function(err, result) {
  // ...
});

const Navigation = function() {
    return (
        <Navbar>
            <Navbar.Brand href="#">
                <img src="https://www.develop.realtystore.com/resources/site/images/logos/logo.png" alt="brand logo" className="brand-logo" />
            </Navbar.Brand>
        </Navbar>
    )
}

export default Navigation;
